Bevor es damit losging wurde noch eine Analyse der Körperzusammensetzung vorgenommen, welche die eigenen Schwächen gnadenlos aufdeckt: Rumpfstabi🤦🏼‍♂️ Auf dem Weg zur neuen Bestzeit heißt es deshalb für mich ganz klar Hausaufgaben machen ☝️
.
Auf dem Laufband ging es dann für mich bei 10km/h los. Jede Minute wurde es 0,8km/h stufenlos schneller. Die aerobe Schwelle hinter mir gelassen ging es unaufhaltsam in Richtung anaerober Schwelle 🚀. Nach dieser wurde es dann langsam eklig... bei 21,6km/h (~2:46min/km) war dann jedoch Schluss für mich 😰
.
Eine VO2max von 70 nur gaaaanz knapp verpasst, bin ich sehr froh, dass auf Garmin verlass ist und meine 69 bestätigt wurden. 💪
.
